import React from 'react';
import Hero from "../Hero";
import Banner from '../Banner';
import {Link} from 'react-router-dom';
import "./style.scss";

export default function Services ({name, title}) {

    return (
      <>
      <Hero>
        <Banner title="I Offer the following services to my clients" subtitle="I am Looking foward to working with you">
          <Link to='/about' className="btn-primary">
            portfolio
          </Link>
        </Banner>
      </Hero>
      <div>
          <h1>Hello from My Services</h1>
      </div>
      </>
    )
}
